import React from 'react';
import Banner from '../../components/Banner'
import RocketLayout from '../../components/RocketLayout'
import PastLayout from '../../components/PastLayout'

const RocketsPage = () => {
  return (
    <div>
      <Banner title={"rockets"} />
      <RocketLayout/>
      <PastLayout/>
    </div>
  );
};

export default RocketsPage;
